    const [title, setTitle] = useState("") 
    return (
    <div>
    <header>
    <h1>To Do List:</h1>
    </header>
    <form id="add-todo-form">
    <label for="add">Title:</label>
    <div id="add-bar">
    <input onChange={(event) => changeTitle} id="bar" name="add" type="text"/>
    <input className="submit" type="submit" value="Add"></input>
    </div>
    </form>
     <ul id="to-do-list">
     <li>{title}</li> 
     </ul>
    </div>
    )
 }

